import React, { useEffect, useState } from 'react';
import axios from 'axios';

const TenantList = () => {
    const [tenants, setTenants] = useState([]);

    useEffect(() => {
        fetchTenants();
    }, []);

    const fetchTenants = async () => {
        try {
            const response = await axios.get('http://localhost:3001/tenants'); // Ajoutez le port 3001 ici
            setTenants(response.data);
        } catch (error) {
            console.error('Erreur lors de la récupération des locataires', error);
        }
    };

    return (
        <div>
            <h2>Liste des locataires</h2>
            <ul>
                {tenants.map((tenant) => (
                    <li key={tenant.id}>
                        {tenant.name} - {tenant.apartment} - {tenant.rent}€
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default TenantList;
